      <pre>  
      <div id="js-terminal" class="terminal" contenteditable="true"></div>
      </pre>

    </div>


    <script>

    var term = $('#js-terminal');
    var caret;
    var prompts = ['about','help','clear', 'load vr'];


    var about_prompt = "\nAbout\nCUVR is the newest breed of project team. We are super dope.\n";
    var help_prompt = "\nHELP\nBio - A list of EBoard Bios.\nAbout - About cuvr.\n"
    var loading_prompt = "... loading ...\n";


    function placeCaretAtEnd(el) {
      el.focus();
      if (typeof window.getSelection != "undefined"
          && typeof document.createRange != "undefined") {
          var range = document.createRange();
          range.selectNodeContents(el);
          range.collapse(false);
          var sel = window.getSelection();
          sel.removeAllRanges();
          sel.addRange(range);
      } else if (typeof document.body.createTextRange != "undefined") {
          var textRange = document.body.createTextRange();
          textRange.moveToElementText(el);
          textRange.collapse(false);
          textRange.select();
      }
    };

    function getInput(){
      var text = term.html();
      var input = text.substring(caret);
      return input.toLowerCase();
    }

    $(document).ready(function(){
      var date = '' + new Date();
      term.text('Last login: ' + date.substring(0, date.length - 15) + ' on ttys000\nCUVRdev-MacBook-Pro:~ CamlBois$ ');
      placeCaretAtEnd( document.getElementById("js-terminal") );
      caret = term.html().length;
    });


    term.on("keypress", function(e) {
        if (e.keyCode == 13) {
          var input = getInput();

          if (prompts.indexOf(input) < 0) {
            term.append('\n-bash: '+input +': command not found\n');
          }
          else {
            switch(input) {
              case 'about':
                  term.append(about_prompt);
                  break;
              case 'help':
                  term.append(help_prompt);
                  break;
              case 'clear':
                  term.html('');
                  break;
              case 'load vr':
                  term.append(loading_prompt);
                  window.location='vr.html';
                  break;
              default:
                  break;
            }
          }

          term.append('CUVRdev-MacBook-Pro:~ CamlBois$ ');
          caret = term.html().length;
          placeCaretAtEnd( document.getElementById("js-terminal") );
          return false;
        }
    });

    term.on('keydown', function(e) {
      if (e.keyCode == 8) {
        var last = term.html().substring(term.html().length - 10);
        if (last == "CamlBois$ ") {
          return false;
        }
      }
    });


    </script>
